import React, {useState} from 'react';
import '../css/RentalItem.css'
import { useNavigate } from 'react-router-dom';

const RentalItem = () => {
    const navigate = useNavigate();
    const [showSoldOnly, setShowSoldOnly] = useState(false);

    // 렌탈 아이템 데이터(예제)
    const rentalItems = [
        { id: 1, imageUrl: 'data:image/jpeg;base64,', title: '렌탈 상품 1', price: '10,000', isSold: true },
        { id: 2, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQWYDyeGY6WG2SomQa6wB6nBlf4LbbAa_UuUA&s', title: '렌탈 상품 2', price: '15,000' },
        { id: 3, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTXeIJMkXbhNfziM6ur_VxywDmESPawWmDV9g&s', title: '렌탈 상품 3', price: '20,000' },
        { id: 4, imageUrl: 'data:image/jpeg;base64,', title: '렌탈 상품 4', price: '10,000', isSold: true },
        { id: 5, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQWYDyeGY6WG2SomQa6wB6nBlf4LbbAa_UuUA&s', title: '렌탈 상품 5', price: '15,000' },
        { id: 6, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTXeIJMkXbhNfziM6ur_VxywDmESPawWmDV9g&s', title: '렌탈 상품 6', price: '20,000' },
        { id: 7, imageUrl: 'data:image/jpeg;base64,', title: '렌탈 상품 7', price: '10,000' },
        { id: 8, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQWYDyeGY6WG2SomQa6wB6nBlf4LbbAa_UuUA&s', title: '렌탈 상품 8', price: '15,000' },
        { id: 9, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTXeIJMkXbhNfziM6ur_VxywDmESPawWmDV9g&s', title: '렌탈 상품 9', price: '20,000' },
        { id: 10, imageUrl: 'data:image/jpeg;base64,', title: '렌탈 상품 10', price: '10,000', isSold: true },
        { id: 11, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQWYDyeGY6WG2SomQa6wB6nBlf4LbbAa_UuUA&s', title: '렌탈 상품 11', price: '15,000' },
        { id: 12, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTXeIJMkXbhNfziM6ur_VxywDmESPawWmDV9g&s', title: '렌탈 상품 12', price: '20,000' },
        { id: 13, imageUrl: 'data:image/jpeg;base64,', title: '렌탈 상품 13', price: '10,000' },
        { id: 14, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQWYDyeGY6WG2SomQa6wB6nBlf4LbbAa_UuUA&s', title: '렌탈 상품 14', price: '15,000' },
        { id: 15, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTXeIJMkXbhNfziM6ur_VxywDmESPawWmDV9g&s', title: '렌탈 상품 15', price: '20,000' },
        { id: 16, imageUrl: 'data:image/jpeg;base64,', title: '렌탈 상품 16', price: '10,000', isSold: true },
        { id: 17, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQWYDyeGY6WG2SomQa6wB6nBlf4LbbAa_UuUA&s', title: '렌탈 상품 17', price: '15,000' },
        { id: 18, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTXeIJMkXbhNfziM6ur_VxywDmESPawWmDV9g&s', title: '렌탈 상품 18', price: '20,000' },
    ];

    const filteredItems = showSoldOnly
        ? rentalItems.filter((item) => item.isSold)
        : rentalItems;

        const handleFilterChange = (event) => {
            const { name, checked } = event.target;
            if (name === "sold") {
                setShowSoldOnly(checked);
            }
        };

        return (
            <div className="page-container">
                {/* 필터 섹션 */}
                <aside className="filter-section">
                    <h3>필터</h3>
                    <div className="filter-options">
                        <label>
                            <input
                                type="checkbox"
                                name="sold"
                                checked={showSoldOnly}
                                onChange={handleFilterChange}
                            />
                            판매 완료만 보기
                        </label>
                        {/* 추가 필터 옵션 */}
                    </div>
                </aside>
    
                {/* 렌탈 아이템 섹션 */}
                <div className="rental-container">
                    {filteredItems.map((item) => (
                        <a href="/" key={item.id} className="rental-item-link">
                            <div className="rental-item">
                                {item.isSold && <span className="sold-badge">판매 완료</span>}
                                <img
                                    src={item.imageUrl}
                                    alt={item.title}
                                    className="rental-image"
                                />
                                <p className="rental-title">{item.title}</p>
                                <p className="rental-price">{item.price}원</p>
                            </div>
                        </a>
                    ))}
                </div>
            </div>
        );


};


export default RentalItem;
